import React, { useEffect, useState } from "react";
import { useSearchParams, useNavigate } from "react-router-dom";
import { handleSuccess } from "../utils";
import { ToastContainer } from 'react-toastify';


function RegistrationForm() {
  const [Marks, setMarks] = useState('');
  const [Percentile, setPercentile] = useState('');
  const [Cast, setCast] = useState('');
  const [error, setError] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8080/shreyapp/register', {
        Marks,
        Percentile,
        Cast,
      });
      console.log(response.data);
    } catch (error) {
      setError(error.message);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>Marks:</label>
      <input type="text" value={Marks} onChange={(e) => setMarks(e.target.value)} />
      <br />
      <label>Percentile:</label>
      <input type="text" value={Percentile} onChange={(e) => setPercentile(e.target.value)} />
      <br />
      <label>Cast:</label>
      <input type="text" value={Cast} onChange={(e) => setCast(e.target.value)} />
      <br />
      <button type="submit">Register</button>
      {error && <p style={{ color: 'red' }}>{error}</p>}
    </form>
  );
}

export default RegistrationForm;
